import { DATA_ANALYSIS } from '../actions/types';

const initialState = {
  categories: [],
  amounts: [],
  data: {}
};

export default function (state = initialState, action) {
  switch (action.type) {

    case DATA_ANALYSIS:
      return action.payload

    default:
      return state;
  }
}
